import { Link } from 'react-router-dom';

import Logout from './Logout';
function header() {
	return (
		<nav className='flex gap-4 items-center border'>
			<div className='w-[300px]'>
				<img src='Logo.png' className='w-[300px]' alt='logo'></img>
			</div>
			<div className='p-3 flex items-center gap-2'>
				<Link to='/foods'>Product</Link>
				<img src='paw.svg' className='w-6' />
			</div>

			<div className='ml-[-20px] flex gap-3'>
				<div className='ml-4 border'>
					<Link to='/cart'>Cart</Link>
				</div>
				<div className='ml-4 border'>
					<button>Profile</button>
				</div>
				<Logout />
			</div>
		</nav>
	);
}

export default header;
